import React, { Component } from 'react'
import { VictoryPie, VictoryLabel } from 'victory'

export class CircleTwo extends Component {
    render() {
        return (
            <div id = "pie2">
            <VictoryPie
                data={[
                    { x: "TV", y: 1187 },
                    { x: "Online Ads", y: 2576 },
                    //{ x: "Appstore", y: 1216 },
                    { x: "Web", y: 3287 },
                    { x: "Recommendation", y: 1968 }

                ]}
                colorScale={["tomato", "navy", "gold", "orange" ]}
                //cornerRadius={({ datum }) => datum.y * 5}
                height={300}
                width={500}
                padAngle={({ datum }) => datum.y}
                padding={{ top: 80, bottom: 60, left: -95 }}
            />
            <VictoryLabel text="length of subscription bought by people from slected age" textAnchor="left"/>
            </div>
        )
    }
}

export default CircleTwo
